import React, { Component } from "react";
import Car from '../../immagini/CAR.png';
import '../../App.css';
import AccessTimeIcon from '@material-ui/icons/AccessTime';
import { green } from '@material-ui/core/colors';
import MonetizationOnIcon from '@material-ui/icons/MonetizationOn';
import MapIcon from '@material-ui/icons/Map';
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { logoutUser, setCurrentUser } from "../../actions/authAutentications";
import { Redirect } from "react-router-dom";

class HomeCliente extends Component {

  constructor(props) {
    super(props);
  }


   onLogoutClick = e => {
      e.preventDefault();
      this.props.logoutUser();
   };
   

   render(){ 
    const { user } = this.props.auth;

    //Redirect
    if(user.ruolo==='Admin')
    this.props.history.push("/Dashboard");
      return( 
         <div className='home'> 
            <div>
            
            <h1 style={{textAlign:'center'}}>Benvenuto, <b>{user.name}</b></h1>
            <h1 style={{textAlign:'center'}}>sei nella home del cliente</h1>
            <button
              style={{
                width: "150px",
                borderRadius: "3px",
                letterSpacing: "1.5px",
                marginTop: "1rem"
              }}
              onClick={this.onLogoutClick}
              className="btn btn-large waves-effect waves-light hoverable blue accent-3"
            >
              Logout
            </button>
            </div>
         </div>
      ); 
   } 
}

HomeCliente.propTypes = {
    logoutUser: PropTypes.func.isRequired,
    auth: PropTypes.object.isRequired
  };
  
  const mapStateToProps = state => ({
    auth: state.auth
  });
  
  export default connect(
    mapStateToProps,
    { logoutUser }
  )(HomeCliente);
